commits.content:
// 默认尺寸
@prefix: 'SnowBoll';

@FloatingBollPrefix: ~'@{prefix}-floating-boll';
@transition-time: 0.5s;
@top: 80%;
@right: 15%;
@boll-size: {
    &-small{
        width: 15px;
        height: $width;
    }

    &-middle{
        width: 25px;
        height: $width;
    }

    &-large{
        width: 35px;
        height: $width;
    }
};

@boll-position:{
    position: fixed;
    top: @top;
    right: @right;
}


.@{FloatingBollPrefix}{
    transition: transform @transition-time;
    background-repeat: no-repeat;
    background-size: cover;
    @boll-position();
    @boll-size();

    &:hover{
        transform: scale(1.1);
